            <div style={{display:'flex',flexDirection:'row',justifyContent:'center',padding:20,marginTop:100,backgroundColor:'transparent'}}>
                <Card>
                    <CardContent>
                        <Typography color={'primary'}>
                        This is all what we have around your area ):
